Clays are tough and can be moulded into shapes when moist. Clays form a long flexible ribbon when rubbed between the palms and the ribbon can often be bent into a U shape without breaking. Clays dry into very hard clods. (VDEPI 2009: AG0058){Soil_Texture_Helper}
The wetted soil feels very gritty when rubbed on the palm and with forefinger.{Soil_Texture_Helper}
A sandy clay is like a clay but sand grains can be felt (and heard - see Sandy Loam). (VDEPI 2009: AG0058){Soil_Texture_Helper}
