The wetted soil does NOT feel very gritty when rubbed on the palm and with forefinger.{Soil_Texture_Helper}
The wetted soil feels very smooth when rubbed on the palm and with forefinger.{Soil_Texture_Helper}
A silty loam is like a loam but has a smooth silky feel when a moist sample is pushed between the index finger and thumb. On drying a sample can form a hard lump but this may be broken by hand. (VDEPI 2009: AG0058){Soil_Texture_Helper}
The wetted soil does NOT feel very smooth nor very gritty when rubbed on the palm and with forefinger.{Soil_Texture_Helper}
A loam breaks into crumbs but will tend to stick together. Sand grains cannot be felt in a moist sample which when squeezed will retain its shape when handled freely. Loams are usually soft to the feel. (VDEPI 2009: AG0058){Soil_Texture_Helper}
The wetted soil feels very gritty when rubbed on the palm and with forefinger.{Soil_Texture_Helper}
A sandy loam sticks together more than a loamy sand but can be easily broken. Individual sand grains can be felt and heard if a wet sample is rubbed between the index finger and thumb and held close to the ear. (VDEPI 2009: AG0058)

